import 'bulma/css/bulma.min.css';
import {Container,Heading} from "react-bulma-components"
import Hero from 'react-bulma-components/src/components/';

function App() {
  return (
    <div >
    <Hero color="primary">
      <Hero.Body>
        <Container>
          <Heading>
          Hero title Primary
          </Heading>
          <Heading subtitle size={3}>
          Subtitle
          </Heading>
        </Container>
      </Hero.Body>
    </Hero>
    </div>
  );
}

export default App;
